function readFile(p){
try {
var filelo = new java.io.File(p);
var strin = new java.lang.StringBuilder();
var fos = new java.io.FileInputStream(filelo);
var jk;
var o;
while((jk = fos.read()) != -1)
strin.append(java.lang.Character(jk));
o = strin.toString();
    fos.close();
	}
	catch(err){return null}
	return o;
}


